import React from 'react'

const Products = (props) => {
    console.log(props.product.products);
  return (
    <>
    <ol>
      {props.product.products.map((item)=>{
         <li>{item.title}
         <img src={item.thumbnail}/>
         <p>{item.description}</p>
         <h3>${item.price}</h3>
         </li>
      })}
      </ol>  
    </>
  )
}

export default Products
